export const styles = theme => ({
    root: {
        [theme.breakpoints.between("md", "xl")]: { minHeight: "332px" },
        [theme.breakpoints.between("xs", "md")]: { padding: theme.spacing(2) },
    },
    title: {
        display: "block",
        margin: `${theme.spacing(4)}px 0`,
        [theme.breakpoints.between("xs", "md")]: {
            margin: `${theme.spacing(2)}px 0`,
        },
    },
    breaktitle: { display: "block" },
    pointer: { cursor: "pointer" },
});
